raw_question: Find all airlines that have flights from both airports 'APG' and 'CVO'. 
question_index: 237 
constants:
 - APG
 - CVO
join_columns:
 - airline
 - uid
columns:
 - sourceairport
filters:
 - '='
ieu:
 - intersect
comment: |-
  SELECT T1.Airline
  FROM AIRLINES AS T1
  JOIN FLIGHTS AS T2 ON T1.uid = T2.Airline
  WHERE T2.SourceAirport = "APG" INTERSECT
    SELECT T1.Airline
    FROM AIRLINES AS T1
    JOIN FLIGHTS AS T2 ON T1.uid = T2.Airline WHERE T2.SourceAirport = "CVO"

